import { createSlice } from '@reduxjs/toolkit';

export const tableSlice = createSlice({
  name: 'table',
  initialState:[],
  reducers: {
    setSensorData: (state, {payload}) => {
      state = payload;
    }
  }
});

export const { setSensorData } = tableSlice.actions;

export default tableSlice.reducer;
